import { func } from 'prop-types';
import React from 'react'

function formatarNome (usuario) {
  return usuario.nome+''+usuario.sobrenome
}

function App() {
 let imagem = 'https://logodownload.org/wp-content/uploads/2014/09/google-logo-0.png'

  return <>
    <img src="{imagem}" />
  </> 
}

export default App;
